import React from 'react';
import './App.css';
import Countdown from './components/Countdown';

const events = require("./countdown-list.json");

function App() {



  function check(event) {
    console.log(event.length);
    if (event === []) {

      return res = <h1>Make a new event!</h1>;
    } else {
      return res = <div className="App">
        <h1>Hello World</h1>
        {events.map(event =>
          <Countdown
            key={event.id}
            title={event.title}
            month={event.month}
            day={event.day}
            year={event.year}
          />
        )}
      </div>
    }
  }

  var res = null;
  let getEvents = (events.map(event => {
    return event
  }
  ));
  check(getEvents);
  return res;
}

export default App;
